import React, { Component,Fragment } from 'react';
import { Redirect } from 'react-router'


class ShowPlayers extends Component {
  constructor(props){
    super(props)
    this.state = {
      players : props.location.state.playersInGame,
      test: "blabla"
    }
  }
  componentDidMount() {
    this.setState({players:"123"})
  }

  render() {
    let player;
    try {
       player = this.state.players.map(elem => (
        {
          name: elem.name,
          lastname: elem.lastname,
          total_time: elem.total_time,
          total_distance: elem.total_distance,
          sprint_distance: elem.sprint_distance,
          total_sprint: elem.total_sprint,
          sprint_avg: elem.sprint_avg

        } 
      ));
    }catch{

    }

    console.log(this.state.test);

    return (
      <Fragment>
        <table>
        <thead>
        <th>Player Name</th>
          <th>Last Name</th>
          <th>Total Time</th>
          <th>Distance (km)</th>
          <th>Sprint Distance</th>
          <th> Total Sprints</th>
          <th>Sprints Avg(MP/H).</th>
        </thead>
      {player.map((player) => (
        <tbody>
        <td> {player.name}</td>
        <td> {player.lastname}</td>
        <td> {player.total_time}</td>
        <td> {player.total_distance}</td>
        <td> {player.sprint_distance}</td>
        <td> {player.total_sprint}</td>
        <td> {player.sprint_avg}</td>
        </tbody>
      ))}
        </table>
      </Fragment>
    )
  }
}
export default ShowPlayers;
